function createDyOut(){ return  {
    keys: [],
    fun: function (k, interval, f) {
        dyOut.keys[k] = { s: k, t: null };
        dyOut.keys[k].t = setTimeout(function () {
            if (dyOut.keys[k] && dyOut.keys[k].s != -1)
                f();
            dyOut.keys[k] = null;
        }, interval);
    },
    stop: function (k, interval) {

        if (interval) {
            setTimeout(function () {
                dyOut.keys[k].s = -1;
                if (dyOut.keys[k] && dyOut.keys[k].t) clearTimeout(dyOut.keys[k].t);
            }, interval);
        }
        else if (dyOut.keys[k]) {
            dyOut.keys[k].s = -1;
            if (dyOut.keys[k] && dyOut.keys[k].t) clearTimeout(dyOut.keys[k].t);
        }
    }
}};


